B C PD 3.0 (support max 100w input), 2 USB 3.0 (up to 5Gbps), 2 USB 2.0 for wireless keyboard or mouse, SD/Micro SD(can read and write at the same time), RJ45 wired Gigabit Ethernet (10/100/1000Mbps), 3.5 mm Audio and 2 USB C host (connect to the MacBook Pro and dock).', 'This USB C MacBook dual HDMI docking station is plug and play, no need for any other drivers. Iust uses one USB C cable with two outputs to extend dual monitors and the dual USB C cable is included.']
